(async()=>{const o="https://api.coingecko.com/api/v3/simple/price?ids=bitcoin&vs_currencies=usd";console.log(`Fetch url: ${o}`);const c=await fetch(o,{method:"GET",headers:{"Content-Type":"application/json",Accept:"application/json"}}).then((o=>{console.log(`Response status code: ${o.status}`)})).catch((function(o){console.log(`Error: ${o}`)})),s=await c.json();console.log(s)})();